import React from 'react'

export const TableToDo = (props) => {

    let { todos } = props
    let arr = todos.map((el, index) => {
        return (
            <h1 key = {index}>{el}</h1>
        )
    })
    return(
        <div>
            {arr}
        </div>
    )
}
